import Tour from './Tour'

const Tours = (({tours})=>{
    return (

        <section>
        <div className='title'>
            <h2>Ours Tours</h2>
            <div className='underline'>

            </div>
        </div>
        <div>
            {tours.map((tour) =>{
                return <Tour key={tour.id}> </Tour>
            })}           
        </div>
    </section>   
    )
})

export default Tours;
